r;">Composición:</span></span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); text-align: justify;">Atún (28.1%), Aductor de vieira (1.8%), Harina de arroz, Extracto de vieira, Minerales, Azúcares, Aceites vegetales, Goma guar.</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; line-height: normal; font-size: 1.42188rem; font-family: &quot;Roboto Condensed&quot;, sans-serif; color: rgb(61, 61, 61); letter-spacing: 0.02em; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-weight: bolder;"><span style="box-sizing: border-box; font-size: 12pt;">Componentes y niveles analíticos:</span></span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); text-align: justify;">Proteína (min) 7.00%, Contenido de grasa (min) 0.20%, Fibra bruta (max) 0.10%, Ceniza bruta (max) 2.00%, Contenido de humedad (max) 91.00%</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; line-height: normal; font-size: 1.42188rem; font-family: &quot;Roboto Condensed&quot;, sans-serif; color: rgb(61, 61, 61); letter-spacing: 0.02em; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 12pt;"><span style="box-sizing: border-box; font-weight: bolder;">Directrices de alimentación:</span></span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); text-align: justify;">Ofrécelo a tu gato como un snack. Este producto no está destinado a sustituir una comida. Proporciónale agua limpia y fresca diariamente. Visita al veterinario periódicamente para la buena salud de tu mascota.</p><p st