('230de29c-4f93-49a3-b54d-2e923266d995', (SELECT id FROM categories WHERE tenant_id = '230de29c-4f93-49a3-b54d-2e923266d995' AND slug = 'alimento-gato'), (SELECT id FROM brands WHERE tenant_id = '230de29c-4f93-49a3-b54d-2e923266d995' AND slug = 'pro-plan'), 'ADULT CAT 3 KG', 'ADULT CAT 3 KG<div><br></div><div><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Drontal Antiparasitario para Gatos es un antiparasitario interno de amplio espectro especialmente diseñado para gatos.</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><br style="box-sizing: border-box;">Está indicado para el control de nemátodos y céstodos que comúnmente afectan a los gatos:&nbsp;<em style="box-sizing: border-box;">Ancylostoma tubaeforme, Toxocara cati, Toxascaris leonina, Dipylidium caninum, Echinococcus multilocularis, Mesocestoides spp., Joyeuxiella pasqualei.</em></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Dosificación y Modo de Empleo:</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Drontal Antiparasitario para Gatos<span style="box-sizing: border-box; font-weight: bolder;"></span>&nbsp;se administra por vía oral directamente en la boca de la mascota o mezclado con el alimento. No es necesario tomar medidas dietéticas ni suprimir la ración a los animales.</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Una tableta por cada 4 Kg de peso vivo administrada mediante dosis única.</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Realizar al mismo tiempo la desparasitación en todos los perros y/o gatos del hogar.</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(93, 93, 93); font-family: Roboto, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">1 tableta contiene Pamoato de pirantel 230 mg (equivalente a 80 mg de pirantel base), Praziquantel 20 mg, Excipientes c.s.p.<br style="box-sizing: border-box;">Antiparasitario interno.</p></div>', '2374566', '7613039900277', 24900, 16778, 0, '{"size": "Tamaño Unico", "images": "/2369/5d3a2d2ae63a4a1398af4b1edd5af4ae.jpg", "discount": "0"}'::jsonb, true),
